import React from 'react';
import "./Card.css";
import {Link} from "react-router-dom";
// import 'tachyons';

const myFunction =() =>{
	var a = 1+1;
	console.log(a)
}

const Card = () => {
	return (
		<div>
		<br></br><br></br><br></br>
			<div className="grid-layout">    {/*taken from https://stackoverflow.com/questions/8470070/how-to-create-grid-tile-view*/}
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Order Management</h1></div></Link>
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Inventory Management</h1></div></Link>
				<Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Finances</h1></div></Link>
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Menu</h1></div></Link>
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Customer Database</h1></div></Link>
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Loyalty Scheme</h1></div></Link>
				<Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Customer Support</h1></div></Link>
			    <Link><div className="item fkof grow" style={{backgroundColor:"#626E60"}}><h1 className="mera">Restaurant Details</h1></div></Link>
		    </div>
		 	   
		</div>
	);
}
	

export default Card;
